<html>
<head>
<title>Nav Page</title>
<script language="JavaScript" type="text/javascript">
function getUrl(){
	document.value=parent.Content.location.href;
	parent.Content.focus();
}
</script>
</head>

<body leftmargin="0" topmargin="0">
<a name="a"></a>
<table width="100%" height="100%" border="0" cellpadding="0" cellspacing="0" bgcolor="#F5F6F7">
  <tr bordercolor="#F5F6F7">
      <td width="47%" align="left" valign="middle">
        <table width="100%" border="0" cellspacing="0" cellpadding="0">
        <tr>
          <td width="6">&nbsp;</td>
          <td width="23" onclick="javascript:history.go(-1);getUrl()"><div align="center"><a href="#a"><img alt="" src="../../images/icons/internet/back.gif" border="0" /></a></div></td>
          <td width="23" onclick="javascript:history.go(1);getUrl()"><div align="center"><a href="#a"><img alt="" src="../../images/icons/internet/foward.gif" border="0" /></a></div></td>
          <td width="6">&nbsp;</td>
          <td width="49"><font size="2">Address:</font></td>
          <td width="263"><font size="2">
            <input name="address" type="file" id="address" />
          </font></td>
          <td width="5">&nbsp;</td>
          <td width="45"><table width="96%" border="0" cellspacing="0" cellpadding="0" onclick="parent.Content.location.href=address.value">
              <tr>
                <td width="22"><input name="goGet" type="image" class="navButton" value="Go" src="../../images/icons/internet/go.png" /></td>
              </tr>
            </table></td>
          <td width="99%">&nbsp;</td>
        </tr>
      </table>

      </td>
      <td width="1%" align="right" valign="middle">&nbsp;</td>
  </tr>
  <tr bordercolor="#F5F6F7" bgcolor="#666666">
    <td height="1" colspan="3" align="left" valign="middle"></td>
  </tr>
</table>
</body>
</html>
